import React from "react";
import HeaderLogo from "../../assets/headerLogo.png";
import { Container } from "./styles";

const Header: React.FC = () => {
  return (
    <Container>
      <CepArea>
        <img src={HeaderLogo} alt="" />
      </CepArea>
    </Container>
  );
};

export default Header;
